        mHdltvinHandle << " , " <<  " \"LS_stream_TLAST\" :  \"" << LS_stream_TLAST.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"DNN_out_TDATA\" :  \"" << DNN_out_TDATA.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"DNN_out_TVALID\" :  \"" << DNN_out_TVALID.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"DNN_out_TREADY\" :  \"" << DNN_out_TREADY.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"DNN_out_TLAST\" :  \"" << DNN_out_TLAST.read() << "\" ";
